import React from "react";
import logo from "../assets/Logo.png";
import logout from "../assets/logout.png";
import ButtonSecondary from "../components/ui/ButtonSecondary";
import { useNavigate } from "react-router-dom";
import { useDineEaseContext } from "../context/DineEaseContext";

/**
 * Layout that wraps the logged in parts of the page.
 */
const MainLayout = () => {
  const navigate = useNavigate();
  const { setToken } = useDineEaseContext();

  return (
    <nav className="w-full px-6 py-2 flex gap-3">
      <img src={logo} alt="Logo" className="mr-auto" />

      <ButtonSecondary
        fullWidth={false}
        className="shadow-md"
        onClick={() => {
          setToken(null);
          navigate("/login");
        }}
      >
        <img src={logout} alt="Logout Icon" />
        Log Out
      </ButtonSecondary>
    </nav>
  );
};

export default MainLayout;
